class Report extends BaseController
{
    private $db;
    public function __construct()
    {
        $this->db = db_connect();
    }

    public function autoDetect()
    {
        $OrderItemModel = new \App\Models\OrderItemModel();
        $purchaseOrderModel = new \App\Models\purchaseOrderModel();

        $builder = $this->db->table('tblreserved');
        $builder->select('OrderNo,purchaseNumber,productName,SUM(Qty)total');
        $builder->WHERE('Remarks','Partial Delivery');
        $builder->groupBy('purchaseNumber');
        $data = $builder->get();
        foreach($data->getResult() as $row)
        {
            $order = $OrderItemModel->WHERE('OrderNo',$row->OrderNo)->WHERE('Item_Name',$row->productName)->first();
            if($row->total==$order['Qty'])
            {
                //update the remarks
                $values = ['Remarks','CLOSE'];
                $purchase = $purchaseOrderModel->WHERE('purchaseNumber',$row->purchaseNumber)->first();
                $purchaseOrderModel->update($purchase['purchaseLogID'],$values);
            }
        }
    }

    public function fetchPO()
    {
        $val = $this->request->getGet('value');
        $builder = $this->db->table('tblcanvass_sheet a');
        $builder->select('b.purchaseNumber');
        $builder->join('tblpurchase_logs b','b.canvassID=a.canvassID','LEFT');
        $builder->WHERE('a.OrderNo',$val)->WHERE('b.Remarks','OPEN');
        $builder->groupBy('b.purchaseLogID');
        $data = $builder->get();
        foreach($data->getResult() as $row)
        {
            ?>
            <option><?php echo $row->purchaseNumber ?></option>
            <?php
        }
    }

    public function vendorLedger()
    {
        $vendor = $this->request->getGet('vendor');
        $fdate = $this->request->getGet('fromdate');
        $tdate = $this->request->getGet('todate');
        
        ?>
        <table class='table table-bordered' id="table">
            <thead>
                <th colspan="6">Vendor/Supplier : <?php echo $vendor ?></th>
            </thead>
            <thead>
                <th class="bg-primary text-white">Products</th>
                <th class="bg-primary text-white">PRF No</th>
                <th class="bg-primary text-white">Qty</th>
                <th class="bg-primary text-white">Unit Price</th>
                <th class="bg-primary text-white">Total Price</th>
                <th class="bg-primary text-white">Terms/Warranty</th>
            </thead>
            <tbody>
        <?php
        $builder = $this->db->table('tblcanvass_sheet a');
        $builder->select('a.*,b.Qty,b.Item_Name');
        $builder->join('tbl_order_item b','b.orderID=a.orderID','LEFT');
        $builder->WHERE('a.Supplier',$vendor)->WHERE('b.DateCreated >=',$fdate)->WHERE('b.DateCreated <=',$tdate);
        $builder->WHERE('a.Remarks','Selected');
        $data = $builder->get();
        foreach($data->getResult() as $row)
        {
            ?>
            <tr>
                <td><?php echo $row->Item_Name ?></td>
                <td><?php echo $row->OrderNo ?></td>
                <td><?php echo $row->Qty ?></td>
                <td style='text-align:right;'>PhP <?php echo number_format($row->Price,2) ?></td>
                <td style='text-align:right;'>PhP <?php echo number_format($row->Price*$row->Qty,2) ?></td>
                <td><?php echo $row->Terms ?>/<?php echo $row->Warranty ?></td>
            </tr>
            <?php
        }
        ?>
        <tr><td colspan='6'></td></tr>
        <?php
        $builder = $this->db->table('tblcanvass_sheet a');
        $builder->select('SUM(b.Qty * a.Price)total');
        $builder->join('tbl_order_item b','b.orderID=a.orderID','LEFT');
        $builder->WHERE('a.Supplier',$vendor)->WHERE('b.DateCreated >=',$fdate)->WHERE('b.DateCreated <=',$tdate);
        $builder->WHERE('a.Remarks','Selected')->groupBy('a.Supplier');
        $data = $builder->get();
        if($row = $data->getRow())
        {
            ?>
            <tr>
                <td colspan='4' style="font-weight:bold;">TOTAL</td>
                <td style='text-align:right;font-weight:bold;'>PhP <?php echo number_format($row->total,2) ?></td>
                <td></td>
            </tr>
            <?php
        }
        ?>
            </tbody>
        </table>
        <?php
    }

    public function searchStockReport()
    {
        $location = $this->request->getGet('location');
        $category = $this->request->getGet('category');
        if($category=="ALL")
        {
            $sql = ('Select a.*,SUM(a.Qty)actual,
            SUM(CASE WHEN b.Remarks="Replacement" THEN b.Qty ELSE 0 END)damage,
            SUM(CASE WHEN b.Remarks="For Repair" AND b.Status=1 THEN b.Qty ELSE 0 END)repair,c.categoryName from tblinventory a 
            LEFT JOIN tbldamagereport b ON b.inventID=a.inventID 
            LEFT JOIN tblcategory c ON c.categoryID=a.categoryID WHERE a.warehouseID=:location: GROUP BY a.inventID');
            $query =$this->db->query($sql,[
                "location"=>$location,
                ]);
            foreach ($query->getResult() as $row)
            {
                $total = $row->actual+$row->damage+$row->repair;
                ?>
                <tr>
                    <td><?php echo $row->productID ?></td>
                    <td><?php echo $row->productName ?></td>
                    <td><?php echo $row->categoryName ?></td>
                    <td style="text-align:right;"><?php echo number_format($row->actual,0) ?></td>
                    <td style="text-align:right;"><?php echo number_format($row->damage,0) ?></td>
                    <td style="text-align:right;"><?php echo number_format($row->repair,0) ?></td>
                    <td style="text-align:right;"><?php echo number_format($total,0) ?></td>
                </tr>
                <?php
            } 
        }
        else
        {
            $sql = ('Select a.*,SUM(a.Qty)actual,
            SUM(CASE WHEN b.Remarks="Replacement" THEN b.Qty ELSE 0 END)damage,
            SUM(CASE WHEN b.Remarks="For Repair" AND b.Status=1 THEN b.Qty ELSE 0 END)repair,c.categoryName from tblinventory a 
            LEFT JOIN tbldamagereport b ON b.inventID=a.inventID 
            LEFT JOIN tblcategory c ON c.categoryID=a.categoryID WHERE a.warehouseID=:location: AND a.categoryID=:category: GROUP BY a.inventID');
            $query =$this->db->query($sql,[
                "location"=>$location,
                'category'=>$category,
                ]);
            foreach ($query->getResult() as $row)
            {
                $total = $row->actual+$row->damage+$row->repair;
                ?>
                <tr>
                    <td><?php echo $row->productID ?></td>
                    <td><?php echo $row->productName ?></td>
                    <td><?php echo $row->categoryName ?></td>
                    <td style="text-align:right;"><?php echo number_format($row->actual,0) ?></td>
                    <td style="text-align:right;"><?php echo number_format($row->damage,0) ?></td>
                    <td style="text-align:right;"><?php echo number_format($row->repair,0) ?></td>
                    <td style="text-align:right;"><?php echo number_format($total,0) ?></td>
                </tr>
                <?php
            }
        }
    }

    public function searchInventory()
    {
        $from = $this->request->getGet('from');
        $to = $this->request->getGet('to');
        $location = $this->request->getGet('location');
        $validation = $this->validate([
            'from'=>'required','to'=>'required',
            'location'=>'required'
        ]);
        if(!$validation)
        {
            ?>
            <tr>
                <td colspan="7"><center>No Data(s)</center></td>
            </tr>
            <?php
        }
        else
        {
            $sql = ('Select a.productID,a.productName,SUM(a.Qty)actual,a.unitPrice,b.total,c.categoryName from tblinventory a  
            LEFT JOIN (Select inventID,accountID,COUNT(scanID)total from tblscanned_items WHERE Status=1 AND Date BETWEEN :from: AND :to: GROUP BY inventID) b ON b.inventID=a.inventID
            LEFT JOIN tblcategory c ON c.categoryID=a.categoryID
            LEFT JOIN tblaccount d ON b.accountID=d.accountID
            WHERE d.warehouseID=:location: GROUP BY a.inventID');
            $query =$this->db->query($sql,[
                "from"=>$from,
                "to"=>$to,
                "location"=>$location
                ]);
            foreach ($query->getResult() as $row)
            {
                $total = $row->actual - $row->total;
                $totalamount = $total * $row->unitPrice;
                ?>
                <tr>
                    <td><?php echo $row->productID ?></td>
                    <td><?php echo $row->productName ?></td>
                    <td><?php echo $row->categoryName ?></td>
                    <td style="text-align:right;"><?php echo number_format($row->actual,0) ?></td>
                    <td style="text-align:right;"><?php echo number_format($row->total,0) ?></td>
                    <td style="text-align:right;"><?php echo number_format($total,0) ?></td>
                    <td style="text-align:right;">PhP <?php echo number_format($totalamount,2) ?></td>
                </tr>
                <?php
            }
        }
    }

